import React from 'react';
import SponsorList from './SponsorList'; // Переконайтеся, що шлях правильний

const Footer = () => {
    // Список спонсорів
    const sponsors = [
        {
            name: 'Sponsor 1',
            website: 'https://ua.puma.com/uk/?&utm_source=GGL&utm_medium=BS&utm_campaign=ggl_bs_np_ser_brand_exact_search_ukraine&gad_source=1&gclid=Cj0KCQiAw6yuBhDrARIsACf94RXi-XVYVrIq_hMztlVxjxBN8723QSNgaShak6_rqEJI9R0jfBBA4X4aAqWWEALw_wcB',
            image: 'https://papik.pro/uploads/posts/2021-11/thumbs/1636097652_26-papik-pro-p-logotip-puma-foto-29.jpg'
        },
        {
            name: 'Sponsor 2',
            website: 'https://example.com/sponsor2',
            image: 'sponsor2.jpg'
        },
        // Додайте решту спонсорів за аналогією
    ];

    return (
        <footer>
            <SponsorList sponsors={sponsors} />
            <p className="footer-text">Всі права захищені &copy;</p>
        </footer>
    );
};

export default Footer;
